sys_variable_value.value:
(function execute(inputs, outputs) {
    var successCodes = ['200', '202', '201'];
    var arrayUtil = new global.ArrayUtil();
    if (arrayUtil.contains(successCodes, inputs.status)) {
        var responseBody = JSON.parse(inputs['responseBody']);
        var images = responseBody['value'];
        var listImages = [];
        var data = [];
        var imageDetails = [];
        images.forEach(function(property) {
            listImages.push({
                label: property.name,
                name: property.id
            });
            imageDetails.push(property);
        });
        outputs.listimages = {
            data: listImages
        };
        outputs.imagedetails = {
            'ImageDetails': imageDetails
        };
        outputs.status = 'Success';
    } else {
        new azureComputeUtils().postErrorHandling(inputs, outputs);
    }
})(inputs, outputs);

